rs, handling/driving local apps escalation process, investigating customer technical needs/problems and providing solutions, conducting final acceptance, demonstrating products, and understanding competitive situations, methodology, and performance group analysis.  Report technology development and new applications to Marketing. Support pre-sale and post-sale activities.\r\n-Characterization new systems and features.  This includes designing and conducting experiments, collecting data, publishing results and recommendations in the form of applications notes, best known methods or characterization studies.\r\nWork experience in semiconductor processing or equipment industry preferred.  Candidates must be desiring to travel up to 75% on short notice and enjoy working in other cultures.  Team work is critical so having a good balance between technical skills and people skills is a must.  Excellent English communications are required, and competency in Mandarin, Korean or Japanese are all plusses. \r\nQualifications: ME/Mtech/MS/MSc/Phd in Electronics, Electrical, Physics, VLSI, Material Science, Metallurgy, Mechanical, Chemical, Control Systems, Instrumentation, Nanotechnology.  \r\n\r\nCompany Description:\r\n\r\nKLA-Tencor Corporation (NASDAQ: KLAC), a leading provider of process control and yield management solutions, partners with customers around the world to develop state-of-the-art inspection and metrology technologies. These technologies serve the semiconductor, data storage, LED, photovoltaic, and other related nanoelectronics industries. With a portfolio of industry-standard products and a team of world-class engineers and scientists, the company has created superior solutions for its customers for over 30 years. Headquartered in Milpitas, California, KLA-Tencor has dedicated customer operations and service centers around the world. Additional information may be found at www.kla-tencor.com.',' ','',7,1,'0','0','0',65,65,950000,0,1350000,0,0,0,0,0),(92,'Groupo