iendships.\r\n\r\nFinal Projects\r\nTechnology Analysts spend the last four weeks of training on live projects, sponsored by Morgan\r\nStanley groups seeking technical solutions to real business needs. Projects are designed to integrate\r\nbusiness concepts and technical skills taught in the program, reinforce values through teamwork, and\r\nprovide smooth transition to future work groups. Technology Analysts are required to apply the\r\nappropriate technologies to complete the projects according to the specifications and needs of their\r\nclients and sponsors. Final projects are presented to senior management and are implemented and\r\ndeployed into the Morgan Stanley environment where appropriate.\r\n\r\nIndividualized Placement\r\nTechnology Analysts are offered a tailored and individualized approach to placement. Analysts have\r\nthe opportunity throughout the program to meet with managers for a variety of positions. Analysts\r\npreferences are weighed along with the preferences of hiring managers in conjunction with business\r\npriorities.\r\n\r\nLaunching Your Career\r\nOur technology teams are tasked with meeting clients, analyze requirements, make system design\r\ndecisions, evaluate and develop software in various Investment Banking functions like Front office\r\ntrading, risk management, corporate banking, and treasury operations etc. for products in equity, fixed\r\nincome, FX and derivatives. Developing high performing low latency electronic trading systems across\r\nmultiple asset classes, providing sophisticated risk management analytics and systems, and evolving\r\ncomplex workflows and life-cycle management capabilities across increasingly sophisticated products\r\nare just some of the many projects available for developers within our technical organizations.',' ','',6.5,1,'0','0','0',0,0,1398000,0,0,1398000,0,0,0,0),(94,'Directi-Software Developer',65,NULL,NULL,4,0,0,0,1200000,2066216,0,NULL,0,'0','Mumbai , Delhi , Bangalore','Software Developer','h