ucture. Being extremely goal-oriented and a natural leader certainly help. Fresh graduates are warmly welcomed.\r\n\r\nAs a key technical staff, you will work closely with senior management and have a vast influence on the group?s future. For the right person, it is certainly a rare career opportunity.\r\n\r\n? The Information Technology (IT) Architect will be the driving force behind IT strategy and policy\r\nundertakings to improve the business efficiency and effectiveness while achieving sustainable stability and security.\r\n\r\n? Lead the team by determining resource allocation & unifying competencies of team members to complete multiple projects.\r\n\r\n?Build and manage hardware, networks and software infrastructure in the office.\r\n\r\n? Initiate and supervise the implementation of software, hardware and network projects to meet existing operationals and expansion needs.','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Well-versed in technical design of modular & reusable system architecture. ? Working knowledge in Unix/Linux as well as Windows Server environment. ? Major roles in at least 3 full SDLC experience in developing Java/JEE applications will be especially appreciated. ? Excellent communication skills in English are a must. ? Fanatical about the quality and success of projects, the Information Technology (IT) Architect is expected to be a supervisor at times and a hands-on person at others. ? Experienced in developing large scale client servers, web technologies, system integration, SOA, multi-tier,MVC, code refactoring, HA, clustering,network/data security.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(101,'SOFTWARE ENGINEERS',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','SOFTWARE ENGINEERS','THE SOFTWARE ENGINEER will be mainly involved in software projects to meet the group?s business expansion requirements. The major\r\nresponsibilities include:\r\n\r\n? Proposing technical solutions and implementing the solutions in a timely, secure and reliable manner.\r\n? Documenting software system concisely and sufficiently.\r\n? Maintenance of legacy system to ensure business continuity.\r\n? Staff training on software systems to improve business efficacy.','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Involved in at least 1 full SDLC and prior experience in web application development. ? A strong understanding of OOPS, UML and RDBMS is crucial. ? Experience in Java/JEE is a must, understanding in PHP, JSP, JBoss, Tomcat, MySQL, Microsoft.Net will be preferred. ? Acquaintance with both Linux/Unix and Windows environment will be advantageous.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(102,'INFRASTRUCTURE ARCHITECT',50,NULL,NULL,2,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','INFRASTRUCTURE ARCHITECT','RESPONSIBILITIES\r\n\r\n? Oversee and manage infrastructure (hardware,\r\nnetworks, software environments) in the group?s\r\ndistributed environment.\r\n? Propose and implement infrastructure solutions in line with the group IT strategy.\r\n? Ensure that the company IT infrastructure is able to cope with the business expansion.\r\n? Evangelise and incorporate cutting edge technologies into the group infrastructure to\r\nimprove performance.','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Well versed in Open Source methodologies and technologies. ? Experienced in Datacenter environment and acquaintance with virtualisation, clustering,data security is essential. ? Working knowledge of data replication methodologies is a must. DRP implementation will be highly preferred. ? Experience in managing access control using active directory and open LDAP. ? Knowledge in computer and network security. ? Hands-on knowledge in designing, implementing and supporting systems in Unix, BSD and Linux as well as Windows Server environment. ? Experience with thin client systems will be advantageous. ? CCNA, Microsoft and Linux Certification will be an added advantage. ? He is expected to be a hands-on, resourceful and organised person. Excellent communication skills in English are a must.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(103,'IT ANALYST',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','IT ANALYST','THE IT ANALYST IS expected to take on a wide spectrum of IT-related responsibilities, including:\r\n\r\n? Software development, implementing infrastructure and network projects.\r\n? Assist in staff training on IT systems and policies.\r\n? IT resource management.\r\n? Administrating and maintaining websites, IT systems and infrastructure.\r\n? Handling of IT support requests','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Possesses a very strong degree in Computer Science or IT, has great breadth and depth of practical knowledge (including that of Open Source). ? Open minded and passionate about Information Technology.  ? Able to work with minimal supervision, as well as a team player.  ? He is expected to be a hands-on, multi-tasking, resourceful and organised person.  ? Excellent communication skills.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(104,'WEB DESIGNER',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','WEB DESIGNER','THE WEB DESIGNER role encompasses revamping our current websites and designing new websites for the group. The role also includes constantly\r\nmaintaining, improving and updating the group?s websites. You are expected to lead and follow through with work, from concept to delivery\r\nwithin timeline. Our current websites are:\r\n\r\nwww.icapital.biz\r\nwww.cdam.biz\r\nwww.icapitaleducation.biz\r\nwww.capitaldynamics.com.au\r\nwww.icapital.com.sg','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','Requirements are a degree in Web or Graphic Design with a strong understanding of design, layout and web usability. An ideal candidate should be creative with ideas and be passionate about web design. Additional qualities include being a perfectionist, good with details, self-motivated, resourceful, independent and excellent communication skills. Fluency in English is required and knowing Mandarin is a plus.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(105,'SYSTEMS ANALYST',50,NULL,NULL,0,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','SYSTEMS ANALYSTS','AS PART OF A GLOBAL IT team your responsibilities will include:\r\n? Developing and maintaining Global Websites and web-based applications for in-house use.\r\n? Requirements analysis, Software Design, coding, testing and documentation.\r\n? Researching and Designing relational databases for various IT systems.\r\n? Implementation and continuous maintenance of the systems. Working with the people who use the systems.\r\n? Researching and implementing OSS based technology.\r\n? Travelling and communicating with team members as well as service providers based in other countries.\r\n? Managing multiple projects and work within deadlines.\r\n? Providing IT Support to customers who access our websites','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Passionate about web application development, System Administration and Support, and is a perfectionist. ? Excellent in SQL and variety of database systems such as MySQL, PostgreSQL, MSSQL 2000 and higher. Knowledge of other database systems is an added advantage. ? Excellent understanding of Computer Security and Web Technologies. ? Skilled in web programming languages. PHP, ASP Classic, HTML, CSS, XML. ? Knowledge of scripting languages using Bash, Python and Perl is an advantage. ? Basic system administration of LAMP and Windows Servers. ? A natural with Linux for everyday use. ? Knowledge and experience in OSS tools and OSS CMS, DMS such as Joomla, Drupal, Typo3, Alfresco will give applicants an edge. ? Practical experience in the implementation of E-commerce and Payment gateway is an added advantage. ? Ability to work in a team environment as well as possessing individual responsibility.',7,1,'0','0','0',0,0,1388000,1388000,1850000,0,0,0,1388000,0),(106,'DATABASE SPECIALISTS',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','DATABASE SPECIALISTS','DATABASES are literally the backbone of our business operations and we rely on them to be secure, reliable and dynamic to handle vast amounts of information and to keep our operations running smoothly.\r\n\r\nAs a Database Specialist, your work will encompass the responsibilities of an architect, a designer and a developer / administrator. You need to have an in-depth understanding of database design and structure, and use those skills and knowledge\r\nto maintain their stability, security and reliability.\r\n\r\nYou will need to identify the needs of many stakeholders and to design and implement databases to meet their requirements; your work will\r\nalso extend to installing and troubleshooting databases determining the shortcomings of\r\ndatabases and recommending improvements to meet the demands of swiftly changing interface technology; you will also be in charge of performing backups and encryption procedures to protect the databases.','2 -3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? A solid Computer Science degree is a must. A Master degree in Computer Science and professional certifications in various database platforms will be an asset. ? A solid and wide-reaching foundation in programming and database structures is required. ? A few years of relevant experience in managing databases and system integrations and detailed knowledge of more than one database systems are required. Knowledge of complex database systems is an added advantage.? In addition to possessing technical know-how and being communication savvy, database specialists must also be creative problem solvers.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(107,'e-BUSINESS DEVELOPER',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','e-BUSINESS DEVELOPER','THE e-BUSINESS DEVELOPER will take on a vital role in marrying business development with web technologies. The successful applicant will be expected to take full responsibility in developing e-Business models and technology platforms, and focus on how these can be fully utilised to drive e-business growth.\r\n\r\nFresh graduates are strongly encouraged to apply.\r\n\r\n? Requirements analysis and technology analysis, including evaluation on privacy technologies\r\nand potential threats to information security, to identify and make recommendations on the most suitable technology platforms to be used to shape,\r\ninfluence, and operationalise e-Business strategies and initiatives.\r\n\r\n? Work with management to develop appropriate e-Business strategies and solutions that deal\r\nwith rich interactive online content, and work seamlessly on not only conventional computers,\r\nbut also on ubiquitous system devices such as smart phones, tablets, etc.\r\n\r\n? Work closely with the Web Designer to propose and\r\nimplement standardised web site templates as well as customised website designs for a diversity of\r\nplatforms using Web-based programming, and utilising search engine optimisation techniques in\r\norder to yield optimum website visibility.\r\n\r\n? Implement and manage projects relating to technological solutions to streamline e-Businesses\r\naccording to agreed specifications, whilst\r\naccommodating to constantly evolving business requirements.\r\n\r\n? Establish strong relationships across departments, an understanding of client needs, marketing and branding strategy and operational capabilities to ensure consistent design, implementation and integration of web applications and interface improvements for maximum user\r\nexperience.\r\n\r\n? Maintain a high standard of coding quality and design. Assist in technical design, quality review\r\nand testing of program codes, including but not limited to system integration testing, user\r\nacceptance testing, etc.\r\n\r\n? Ensure timely and quality delivery of applications and services as per the project plan','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? A solid degree in e-Business, e-Commerce, or Computer Science or Information Technology with significant business-related coursework. ? Hands-on experience in developing e-Business and e-Commerce applications (e.g. B2C and B2B), including the integration with merchant payment gateways that supports multiple browsers and browser versions. ? Strong understanding in HTML5, PHP, Perl, LAMP, Tomcat/JSP, MS.net, JavaScript, CSS, XML, and Ajax environment ? Proficient in Objective C programming for iPhone/iOS, iPhone SDK and Android/Java SDK, as well as integration with third party libraries, APIs, and other web services capabilities ebXML, SOAP, WSDL 2.0, will be an advantage. ? Knowledge in interfacing with relational databases (MS SQL, MySQL, Oracle). ? Must be able to work independently on design, coding, debugging, troubleshooting, and deployment as well as solving programming related issues. ? Passionate in building and improving usability and user experience of enterprise web applications ? Multi-tasking team player with excellent time and project management skills.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(108,'DIGITAL MARKETING MANAGER',50,NULL,NULL,3,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','DIGITAL MARKETING MANAGER','CAPITAL DYNAMICS SEEKS a Digital Marketing Manager with 3 to 5 year?s relevant experience. While having experience in managing successful digital marketing campaigns and possessing deep customer insights in the financial services industry are highly preferred, candidates who are very familiar with digital marketing and social media are also encouraged to apply. We seek top-flight digital marketers who share our vision, and possess the technical and personal skills crucial for this role. In short, we need a contributor who has the passion of a zealot in digital marketing.\r\n\r\nThis critical position demands heavy responsibilities and unequivocal commitment. Reporting directly to the CEO, your focus is to develop, execute, and deliver high impact digital marketing strategies and initiatives for the company?s products and services. As such, candidates must demonstrate strong critical thinking and business strategy skills.\r\n\r\nApart from planning and budgeting, you should be well-versed with using digital channels and tools such as corporate websites, social media,\r\nblogs, e-Commerce, web analytics and Search Engine Optimisation to increase brand awareness, drive\r\nacquisitions, and gain and grow the interest of investors in the company?s products and services.\r\nYou must also be a tech-visionary, keeping abreast of latest developments that may serve as a\r\nmedium to boost the company?s brand and profile. You must be able to create and coordinate a range of campaigns for different digital channels as well as working with our small marketing team to integrate the digital marketing strategy with\r\ntraditional marketing and PR strategies.\r\n\r\nYou will assist in improving the design, usability, and conversion points of the company?s Internet presence. Expertise in content management strategy and knowledge of investment jargon\r\nwould be advantageous. You should enjoy compiling and analysing data from various sources to gain\r\ncustomers? insights and always be looking for ways to continuously improve our traffic campaigns. In\r\naddition, you have to be familiar with marketing metrics to track and measure the efficacy of marketing campaigns/efforts.','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? A strong Bachelor?s degree from a reputable University. A major in Marketing, Communications, Finance with Computer Science, or IT is preferred. ? 3 to 5 years of relevant experience in developing and executing digital marketing strategies and plans. Previous experience in the financial services industry would be an added advantage. ? Proven leadership skills, strong written and verbal communication skills. ? Good interpersonal skills and ability to communicate with people from all levels.? Dynamic and creative problem-solvers who thrive in challenging environments. ? Positive attitude, willing to engage in hands-on execution and able to work independently. ? Must enjoy working in a start-up environment and be comfortable with ambiguities.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(109,'WEB DEVELOPER',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','WEB DEVELOPER','? Participate in the complete software development life cycle.\r\n? Develop accurate and efficient web applications according to specifications.\r\n? Responsible for performing coding, testing and develop web applications for different browsers.\r\n? Assist in design of systems and analysis of program specifications.\r\n? Provide development & technical support','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Knowledge of LAMP (Linux, Apache, MySQL, PHP), Javascript (jQuery), HTML and CSS is essential. ? Strong foundation and interest in developing Web 2.0 web sites. ? Good problem solving, communication, interpersonal and organization skills. ? Analytical and conceptual thinking. ? Mature, pleasant personality, diligent, conscientious and an early starter. ? Knowledge of PHP-based CMS like WordPress or Drupal is an added advantage.',7,1,'0','0','0',0,0,1380000,1380000,1850000,0,0,0,1380000,0),(110,'JAVA APPLICATION DEVELOPER',50,NULL,NULL,5,0,0,0,0,1150000,0,0,1,'0','KUALA LUMPUR, MALAYSIA','JAVA APPLICATION DEVELOPER','? Analyse, design, develop, test and document and maintain IT systems or applications.\r\n? Provide maintenance support to internal corporate users by investigating and rectifying reported systems shortcomings.\r\n? Analyse change requests and amend system specifications.\r\n? Update system documentation.','2-3 YEARS DUE TO EMPLOYMENT VISA REQUIREMENTS','? Knowledge of Object-oriented